Прямо сейчас наш крейт неявно подключает стандартную библиотеку. Давайте изменим это, добавив атрибут no_std : // main.rs #![no_std] fn main() { println!("Hello, world!");
} Если мы попробуем скомпилировать наш крейт (с помощью cargo build), то получим ошибку: error: cannot find macro `println!` in this scope --> src/main.rs:4:5 |
4 | println!("Hello, world!"); | ^^^^^^^ Причина этой ошибки в том, что макрос println является частью стандартной библиотеки, которую мы больше не подключаем. Теперь мы не можем ничего распечатать. Это имеет смысл, поскольку println использует стандартный вывод , который представляет собой специальный файловый дескриптор, предоставляемый ОС. Давайте удалим println и попробуем снова с пустой функцией main: // main.rs #![no_std] fn main() {} > cargo build
error: `#[panic_handler]` function required, but not found
error: language item required, but not found: `eh_personality` Теперь компилятор не может найти функцию с атрибутом #[panic_handler] и элемент языка eh_personality.

